import React from "react";
import Shifter from "./Shifter";

const Items = (props) => {
  if (props.data.length === 0) {
    return;
  }

  return (
    <ul>
        {console.log(1)}
      {props.data.map((shifter) => {
        <Shifter time={shifter.time} employee={shifter.employee} />;
      })}
    </ul>
  );
};

export default Items;
